import Link from "next/link";

export default function Menu() {
  return (
    <section className="menu">
      <div className="menu-container">
        <nav role="navigation" className="menu-nav">
          <Link href="/roster">
            <a className="nav-link w-nav-link">Roster</a>
          </Link>
          <Link href="/music">
            <a className="nav-link w-nav-link menu-link">Music</a>
          </Link>
          <Link href="/gamefilm">
            <a className="nav-link w-nav-link">GameFilm</a>
          </Link>
          <Link href="/about">
            <a className="nav-link w-nav-link">About</a>
          </Link>
          <Link href="/contact">
            <a className="nav-link w-nav-link">Contact</a>
          </Link>
        </nav>
      </div>
      <style jsx>{`
        .menu {
          height: 100vh;
          background-color: red;
        }
        .menu-container {
          background-color: black;
          width: 100%;
          height: 100vh;
          position: absolute;
          z-index: 2;
        }

        .menu-nav {
          display: flex;
          flex-direction: column;
          position: absolute;
          bottom: 50%;
          left: 50%;
        }

        h1 {
          color: white !important;
        }
      `}</style>
    </section>
  );
}
